window.bookSummaryJSON = "<p>The New York Times bestselling security droid with a heart (though it wouldn't admit it!) is back in Fugitive Telemetry!</p> <p>No, I didn't kill the dead human. If I had, I wouldn't dump the body in the station mall.</p> <p>When Murderbot discovers a dead body on Preservation Station, it knows it is going to have to assist station security to determine who the body is (was), how they were killed (that should be relatively straightforward, at least), and why (because apparently that matters to a lot of people—who knew?)</p> <p>Yes, the unthinkable is about to happen: Murderbot must voluntarily speak to humans!</p> <p>Again!</p> <p>Performed by David Cui Cui, Gail Shalan, Amanda Forstrom, Aure Nash, Bradley Foster Smith, Chris Stinson, Christopher Walker, Eric Messner, Jenna Sharpe, Joel David Santner, Julienne Irons, Ken Jackson, Khaya Fraites, Michael Glenn, Michael John Casey, Nazia Chaudhry, Scott McCormick, Stephanie Németh-Parker, Wyn Delano, Yasmin Tuazon and Zeke Alton.</p>"; 
